import Buttons from "../.././Components/Buttons";

const Header = () =>{

    return (
        <section className="header">
            <section className="header-top">
                <section className="header-top_logo">
                    <img src="/Users/kraken/Desktop/bulls/src/assets/images/images.png"></img>
                </section>

                <section className="header-top_searchBar">

                </section>

                <section className="header-top_left">
                    <Buttons value = "Sign Up"/> 
                    <Buttons value = "Sign In"/>  

                </section>

            </section>
        </section>
    );
}

export default Header;
